import React, { useEffect, useState } from "react";

const App = () => {
  const [productsBEN, setProductsBEN] = useState([]);
  const [productsSUV, setProductsSUV] = useState([]);
  const [bannerImages, setBannerImages] = useState([]);
  const [newsItems, setNewsItems] = useState([]);
  const [popupVisible, setPopupVisible] = useState(false);
  const [activeCar, setActiveCar] = useState(null);

  const urlApiProductBEN = "http://localhost:3000/productsBEN";
  const urlApiProduct = "http://localhost:3000/productsSUV";
  const urlApiBanner = "http://localhost:3000/banner";
  const urlApiNews = "http://localhost:3000/news";

  useEffect(() => {
    setTimeout(() => {
      setPopupVisible(true);
    }, 3000);

    fetch(urlApiProduct)
      .then((res) => res.json())
      .then((data) => setProductsSUV(data))
      .catch((error) =>
        console.error("Lỗi khi gọi API sản phẩm SUV:", error)
      );

    fetch(urlApiProductBEN)
      .then((res) => res.json())
      .then((data) => setProductsBEN(data))
      .catch((error) =>
        console.error("Lỗi khi gọi API sản phẩm BEN:", error)
      );

    fetch(urlApiBanner)
      .then((res) => res.json())
      .then((data) => setBannerImages(data))
      .catch((error) => console.error("Lỗi khi gọi API banner:", error));

    fetch(urlApiNews)
      .then((res) => res.json())
      .then((data) => setNewsItems(data))
      .catch((error) => console.error("Lỗi khi gọi API news:", error));

    window.addEventListener("scroll", handleScroll);

    return () => {
      window.removeEventListener("scroll", handleScroll);
    };
  }, []);

  const handleScroll = () => {
    const headerMenu = document.querySelector(".header_menu");
    if (window.scrollY === 0) {
      headerMenu.style.backgroundColor = "#ffffff99";
    } else {
      headerMenu.style.backgroundColor = "white";
    }
  };

  const handleCarClick = (index) => {
    setActiveCar(index);
  };

  return (
    <div className="App">
      {/* Banner */}
      <div className="imgBanner">
        {bannerImages.map((banner, index) => (
          <img key={index} src={banner.imgBanner} alt="Banner" />
        ))}
      </div>

      {/* Product BEN */}
      <div className="main_1_renderProduct">
        {productsBEN.map((product, index) => (
          <div key={index} className="col-md-3">
            <div className="card">
              <img className="card-img-top" src={product.img} alt={product.nameCar} />
              <h3 className="card-title">{product.nameCar}</h3>
              <div className="main_1_renderProduct_Action d-flex align-items-center">
                <span className="card-title">Từ {product.price} VND</span>
                <button className="justify-content-end card_button">
                  <i className="bx bx-right-arrow-alt"></i>
                </button>
              </div>
            </div>
          </div>
        ))}
      </div>

      {/* News */}
      <div className="main_5_news">
        {newsItems.map((news, index) => (
          <div key={index} className="col-md-3">
            <div className="card">
              <img className="card-img-top" src={news.img} alt="News" />
              <p className="card-text">{news.describe_news}</p>
              <a className="describe_a" href="#">
                <span>Xem chi tiết</span>
                <button className="describe_button">
                  <i className="bx bx-right-arrow-alt"></i>
                </button>
              </a>
            </div>
          </div>
        ))}
      </div>

      {/* Popup */}
      {popupVisible && (
        <div className="popUpInput">
          <button onClick={() => setPopupVisible(false)}>
            Close Popup
          </button>
        </div>
      )}

      {/* Menu Interaction */}
      <div className="menu">
        {productsBEN.map((car, index) => (
          <div
            key={index}
            className={`main_1_menu_car ${
              activeCar === index ? "main_1_menu_Action" : ""
            }`}
            onClick={() => handleCarClick(index)}
          >
            {car.nameCar}
          </div>
        ))}
      </div>
    </div>
  );
};

export default App;
